// import pokemon from "../models/pokemon";

const myStyle = {
    color: '#ffffff',
    backgroundColor: '#000000',
    };
    
    function Index (props) {

    return (

      <div style={myStyle}>My First React Component!
      
      {/* <h1>{pokemon}</h1> */}
            <ul>
                  {props.pokemon.map((item, index) => 
                    <li key={index}>
                       <a href={`/pokemon/${index}`}><p>{item.name}</p></a> 
